import React, { useState, ChangeEvent } from 'react';

interface ThriveIntakeFormData {
  intakeDate: string;
  navigatorName: string;
  programType: {
    ORIA: boolean;
    EMM: boolean;
    InternalReferral: boolean;
    ORIAOptions: string[]; // Sub-options for ORIA
    InternalReferralOptions: string[]; // Sub-options for Internal Referral
  };
  firstName: string;
  lastName: string;
  dateOfBirth: string;
  gender: string;
  countryOfOrigin: string;
  phoneNumber: string;
  emailAddress: string;
  address: string;
  immigrationStatus: string;
  alienNumber: string;
  eligibilityDate: string;
  programEligibility: {
    receivingServices: boolean;
    ageOver16: boolean;
    livesInWashington: boolean;
    arrivedAfterJuly2021: boolean;
    approvedImmigrationStatus: boolean;
    consentFormCompleted: boolean;
    releaseFormCompleted: boolean;
    immigrationStatusCopy: boolean;
  };
  servicesNeeded: string[];
}

const ThriveIntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<ThriveIntakeFormData>({
    intakeDate: '',
    navigatorName: '',
    programType: {
      ORIA: false,
      EMM: false,
      InternalReferral: false,
      ORIAOptions: [],
      InternalReferralOptions: [],
    },
    firstName: '',
    lastName: '',
    dateOfBirth: '',
    gender: '',
    countryOfOrigin: '',
    phoneNumber: '',
    emailAddress: '',
    address: '',
    immigrationStatus: '',
    alienNumber: '',
    eligibilityDate: '',
    programEligibility: {
      receivingServices: false,
      ageOver16: false,
      livesInWashington: false,
      arrivedAfterJuly2021: false,
      approvedImmigrationStatus: false,
      consentFormCompleted: false,
      releaseFormCompleted: false,
      immigrationStatusCopy: false,
    },
    servicesNeeded: [],
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value, type, checked } = e.target as HTMLInputElement;

    if (type === 'checkbox') {
      if (name.startsWith('programType.')) {
        const field = name.split('.')[1]; // Extract the field name (e.g., ORIA, EMM, etc.)
        setFormData((prev) => ({
          ...prev,
          programType: {
            ...prev.programType,
            [field]: checked,
          },
        }));
      } else if (name.startsWith('ORIAOptions.')) {
        const option = name.split('.')[1]; // Extract the ORIA option (e.g., Affordable Housing)
        setFormData((prev) => ({
          ...prev,
          programType: {
            ...prev.programType,
            ORIAOptions: checked
              ? [...prev.programType.ORIAOptions, option]
              : prev.programType.ORIAOptions.filter((item) => item !== option),
          },
        }));
      } else if (name.startsWith('InternalReferralOptions.')) {
        const option = name.split('.')[1]; // Extract the Internal Referral option (e.g., Economic Empowerment)
        setFormData((prev) => ({
          ...prev,
          programType: {
            ...prev.programType,
            InternalReferralOptions: checked
              ? [...prev.programType.InternalReferralOptions, option]
              : prev.programType.InternalReferralOptions.filter((item) => item !== option),
          },
        }));
      } else if (name === 'servicesNeeded') {
        setFormData((prev) => ({
          ...prev,
          servicesNeeded: checked
            ? [...prev.servicesNeeded, value]
            : prev.servicesNeeded.filter((item) => item !== value),
        }));
      } else {
        setFormData((prev) => ({
          ...prev,
          programEligibility: {
            ...prev.programEligibility,
            [name]: checked,
          },
        }));
      }
    } else {
      setFormData((prev) => ({
        ...prev,
        [name]: value,
      }));
    }
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Thrive Intake Form Data:', formData);
  };

  return (
    <div className="max-w-4xl mx-auto p-6 bg-white shadow-lg rounded-lg">
      <h1 className="text-3xl font-bold text-center mb-6">
        Thrive International Intake/Registration Form
      </h1>
      <form onSubmit={handleSubmit} className="space-y-6">
        {/* Intake Date and Navigator Name */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <label className="block text-sm font-medium text-gray-700">
              Intake Date
            </label>
            <input
              type="date"
              name="intakeDate"
              value={formData.intakeDate}
              onChange={handleChange}
              className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              required
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">
              Navigator Name
            </label>
            <input
              type="text"
              name="navigatorName"
              value={formData.navigatorName}
              onChange={handleChange}
              className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
              required
            />
          </div>
        </div>

        {/* Program Type */}
        <div className="space-y-4">
          <label className="block text-sm font-medium text-gray-700">
            Program Type
          </label>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programType.ORIA"
                checked={formData.programType.ORIA}
                onChange={handleChange}
                className="mr-2"
              />
              ORIA
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programType.EMM"
                checked={formData.programType.EMM}
                onChange={handleChange}
                className="mr-2"
              />
              EMM
            </label>
            <label className="flex items-center">
              <input
                type="checkbox"
                name="programType.InternalReferral"
                checked={formData.programType.InternalReferral}
                onChange={handleChange}
                className="mr-2"
              />
              Internal Referral
            </label>
          </div>

          {/* ORIA Sub-Options */}
          {formData.programType.ORIA && (
            <div className="ml-6 space-y-2">
              <label className="block text-sm font-medium text-gray-700">
                ORIA Options
              </label>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                {['Affordable Housing', 'Teen & Kid Closet', 'Medical', 'Other'].map((option) => (
                  <label key={option} className="flex items-center">
                    <input
                      type="checkbox"
                      name={`ORIAOptions.${option}`}
                      checked={formData.programType.ORIAOptions.includes(option)}
                      onChange={handleChange}
                      className="mr-2"
                    />
                    {option}
                  </label>
                ))}
              </div>
            </div>
          )}

          {/* Internal Referral Sub-Options */}
          {formData.programType.InternalReferral && (
            <div className="ml-6 space-y-2">
              <label className="block text-sm font-medium text-gray-700">
                Internal Referral Options
              </label>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                {['Economic Empowerment', 'Women\'s Empowerment', 'Youth Empowerment'].map((option) => (
                  <label key={option} className="flex items-center">
                    <input
                      type="checkbox"
                      name={`InternalReferralOptions.${option}`}
                      checked={formData.programType.InternalReferralOptions.includes(option)}
                      onChange={handleChange}
                      className="mr-2"
                    />
                    {option}
                  </label>
                ))}
              </div>
            </div>
          )}
        </div>

        {/* Rest of the form remains the same */}
        {/* ... */}

        {/* Submit Button */}
        <div className="flex justify-end">
          <button
            type="submit"
            className="bg-indigo-600 text-white px-6 py-2 rounded-md hover:bg-indigo-700 transition-colors"
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default ThriveIntakeForm;
